    fetch("./getRandomVideo").then(function(data){
      console.log(data);
      console.log("received");
      return data.json();
    }).then(function(obj){
      console.log("2nd then");
      console.log(obj);
      setVideoID(obj.data);
    });
  },[])
  const embedUrl = `https://www.youtube.com/embed/${videoId}`;


  return (
    <h1>This will show history!</h1>
  );
};

export default History;

